                    <div class="founder-title">
                        <h1 class="pt-demi">FOUNDER/CEO</h1>
                        <p class="founder-name pt-bold">RAJEEV K. GOYAL,ESQ.</p>
                    </div>
                    <br />
                    <div class="founder-desc pt-medium">
                        BORN ON LONG ISLAND, NEW YORK, RAJEEV GOYAL IS A BIODIVERSITY
                        CONSERVATIONIST, AUTHOR AND NON-PROFIT LEADER WITH OVER 20 YEARS'
                        EXPERIENCE WORKING ON THE GROUND GRAPPLLING WITH COMPLEX NATURE AND
                        LAND CONSERVATION ISSUES IN OVER 25 COUNTRIES. A GRADUATE OF BROWN
                        UNIVERSITY (BA, ENGLISH LITERATURE), NYU SCHOOL OF LAW (JURIS
                        DOCTORA) AND CORNELL UNIVERSITY (MASTERS OF AGRICULTURE), HIS FIRST
                        BOOK, THE SPRINGS OF NAMJE, TELLS THE STORY OF HIS LIFE AS A
                        VOLUNTEER IN THE PEACE CORPS IN NEPAL. RAJEEV WAS PROFILED BY PETER
                        HESSLER IN NEW YORKER MAGAZINE'S <a href="#" class="bold-link">'WORLD CHANGER' ISSUE.</a>
                    </div>
