            <div class="team-blurb">
                <h2 class="blurb">
                    We operate with an incredibly lean team led by our founder/CEO,
                    supported by volunteers and advisors.
                </h2>
            </div>
            <div class="team-description" id="team-description">
                <h2 class="desc" id="teamdesc">
                    AS A 501(C)(3) NON-PROFIT ORGANIZATION REGISTERED IN THE STATE OF DE,
                    WE ARE SUPPORTED BY AN ACCOUNTING AND LEGAL TEAM IN NEW YORK.
                </h2>
            </div>
            <div class="team-block-right-1" id="team-block-right-1">
                <div id="team-text-block-1">
                    <div class="team-block-title1 team-block-title pt-demi" id="team-block-title1">
                        William Dowell <span class="team-block-subtitle pt-book">BOARD DIRECTOR</span>
                    </div>
                    <div class="team-block-desc1 team-desc-blk pt-medium" id="team-block-desc1">
                        William Thatcher Dowell is a renowned author, journalist, translator
                        and editor/producer. Between 1989 to 2001, Bill served as a
                        correspondent with Time Magazine, where he was the Southeast Asia
                        Bureau Chief from 1995 to 1997, based in Hong Kong. He spent 14 years
                        in the Paris Bureau as a contract stringer, and prior to that was a TV
                        correspondent for ABC News and NBC News, where he reported on and
                        Associate Producer of NPR's "All Things Considered." Bill is the
                        co-author of In the Shadow of the Dragon, with Winter Nie at IMD. Most
                        recently he was the co-editor of The Essential Edge.
                    </div>
                </div>
            </div>
            <div class="team-block-left-1" id="team-block-left-1">
                <div id="team-text-block-2">
                    <div class="team-block-title2 team-block-title pt-demi" id="team-block-title2">
                        DR. RAVINDRA GOYAL, MD. <span class="team-block-subtitle pt-book">BOARD DIRECTOR</span>
                    </div>
                    <div class="team-block-desc2 team-desc-blk pt-medium" id="team-block-desc2">
                        Dr. Ravindra Goyal was born in Nasirabad, Rajasthan. He studied
                        medicine at SMS Medical College in Jaipur before immigrating to the
                        United States in 1974. A critical care pulmonologist for 50 years, he
                        is a donor and philanthropist to many biodiversity causes.
                    </div>
                    <br />
                    <div class="team-block-title3 team-block-title pt-demi" id="team-block-title3">
                        Stephanie I. Handel, CPA, CFE <span class="team-block-subtitle pt-book">Finance Advisor</span>
                    </div>
                    <div class="team-block-desc3 team-desc-blk pt-medium" id="team-block-desc3">
                        Stephanie is a Certified Public Accountant primarily focusing on
                        not-for-profit and governmental organizations. Stephanie graduated
                        Summa Cum Laude from Cornell University where she earned a Bachelor of
                        Science degree in applied economics and management. Stephanie also
                        holds a Master of Science degree in accounting from Syracuse
                        University.
                    </div>
                </div>
            </div>
            <div class="team-block-right-2" id="team-block-right-2">
                <div id="team-text-block-3">
                    <div class="team-block-title4 team-block-title pt-demi" id="team-block-title4">
                        NITESH SINGH <span class="team-block-subtitle pt-book">GRANTS ADMINISTRATOR</span>
                    </div>
                    <div class="team-block-desc4 team-desc-blk pt-medium" id="team-block-desc4">
                        Nitesh Singh is wildlife enthusiast and researcher currently working
                        with the Vertical University project in Nepal as a conservation
                        officer. Holding a master's degree in Environmental Science from the
                        Central Department of Environmental Science, Tribhuvan University, he
                        has carried out many wildlife studies at different elevational
                        gradients of the Himalayas. Nitesh supports grant management and
                        administration at CFF.
                    </div>
                    <br />
                    <div class="team-block-title5 team-block-title pt-demi" id="team-block-title5">
                        LOKENDRA YAKHA <span class="team-block-subtitle pt-book">BOARD DIRECTOR</span>
                    </div>
                    <div class="team-block-desc5 team-desc-blk pt-medium" id="team-block-desc5">
                        Belonging to the Yakha indigenous group of eastern Nepal, Lokendra
                        Bahadur Yakha was born in the hills of Kurule-Tenupa, Dhankuta at the
                        edge of the Koshi river. He is the founder of Tamur Learning Grounds,
                        a board member of the Vertical University project, and a visionary
                        farmer and protector of all life in mountains.
                    </div>
                </div>
            </div>
            <div class="team-block-left-2" id="team-block-left-2">
                <div id="team-text-block-4">
                    <div class="team-block-title6 team-block-title pt-demi" id="team-block-title6">
                        Jeffrey S. Greener <span class="team-block-subtitle pt-book">Legal Advisor</span>
                    </div>
                    <div class="team-block-desc6 team-desc-blk pt-medium" id="team-block-desc6">
                        Jeff counsels many non-profit organizations, including public and
                        private charities, and he is experienced in structuring start-ups,
                        obtaining exemptions, and advising on compliance and governance
                        issues. A frequent lecturer on the topics of estate, retirement, and
                        business planning, Jeff has served as a board member and as chairman
                        of the Alzheimer's Foundation of America. He currently is serving as
                        Deputy Mayor of the Village of Kensington, New York.
                    </div>
                    <br />
                    <div class="team-block-title7 team-block-title pt-demi" id="team-block-title7">
                        Charles Libor <span class="team-block-subtitle pt-book">Graphic Designer</span>
