        <div class="bottom-left-container">
            <div class="bottom-text-block btm-lft-1">
                <div class="bottom-text-block-header pt-bold">
                    REVITALISING <br />BIO-CULTURAL <br />HERITAGE
                </div>
                <div class="bottom-text-paragraph fut-medium">
                    In Nepal, Rajeev also witnessed the commodification of land, and the
                    consequent accelerating pace of land grabbing and fragmentation with
                    the advent of haphazard roads into mountains. He saw firsthand how
                    land grabbing,conversion, and fragmentation are destroying the earth's
                    last intact bio-cultural landscapes, to the point where even the
                    Amazon Rainforest could one day be lost. He also saw the power of
                    small change through the Learning Grounds model.
                </div>
            </div>
            <div class="bottom-text-block btm-lft-2">
                <div class="bottom-text-block-header pt-bold">
                    A different <br />approach to <br />philanthropy
                </div>
                <div class="bottom-text-paragraph fut-medium">
                    THIS BECAME THE CLOUD FOREST FUND APPROACH TO PHILANTHROPY. SMALL
                    FUNDS DEPLOYED AT THE RIGHT TIME CAN MAKE A PROFOUND DIFFERENCE -
                    WHETHER TO HIRE AN INDIGENOUS LAWYER TO AID WITH COMMUNAL LAND
                    TITLING, TO RENT A PONTOON TO TRANSPORT VILLAGERS TO AN IMPORTANT
                    PLANNING MEETING, OR TO HIRE A DRONE TO CAPTURE AN ILLEGAL LAND
                    INVASION THAT CAN BE USED IN COURT - ALL CAN HAVE THE NET EFFECT OF
                    SAVING LITERALLY HUNDREDS OF THOUSANDS OF ACRES OF PRISTINE FOREST AND
                    WETLANDS. WE HAVE SEEN THIS DYNAMIC PLAY OUT OVER AND OVER AGAIN. WHAT
                    IS NEEDED IS A GREAT DEAL OF TIME ON THE GROUND, LISTENING TO THE
                    MOUNTAINS AND UNDERSTANDING THE ROOT CAUSES.
                </div>
            </div>
            <div class="bottom-text-block btm-lft-3">
                <div class="bottom-text-block-header pt-bold">timing is <br />everything</div>
                <div class="bottom-text-paragraph fut-medium">
                    Small funds deployed at the right time can make a profound difference
                    - whether to hire an indigenous lawyer to aid with communal land
                    titling, to rent a pontoon to transport villagers to an important
                    planning meeting, or to hire a drone to capture an illegal land
                    invasion that can be used in court - all can have the net effect of
                    saving literally hundreds of thousands of acres of pristine forest and
                    wetlands. We have seen this dynamic play out over and over
                    again.understanding the root causes.
                </div>
            </div>
        </div>
        <div class="bottom-right-container" style="min-height:100vh;">
            <h1 class="bottom-right-headline pt-bold">OUR APPROACH</h1>
            <div class="bottom-text-block btm-rt-1">
                <div class="bottom-text-block-header pt-bold">Micro-Conservation</div>
                <div class="bottom-text-paragraph fut-medium">
                    Cloud Forest Fund's approach was inspired by the lived experiences in
                    Nepal of our founder, Rajeev Goyal. After serving as a teacher in the
                    Peace Corps, Rajeev pioneered the idea of a 'Vertical University'
                    where the 'professors' of this university could be ordinary farmers,
                    who may not have a Ph.D. or have ever set foot in a school, but
                    possess intricate, intergenerational knowledge about local fauna and
                    flora critical for youth to attain. Over the course of two decades,
                    Rajeev helped establish dozens of learning grounds, essentially
                    micro-conservation hubs  the classrooms of the Vertical University
                    at different elevations. He observed firsthand the incredible agency,
                    dignity and creativity of people who live deep in the forest,
                    connected to land.
                </div>
            </div>
            <div class="bottom-text-block btm-rt-2">
                <div class="bottom-text-block-header pt-bold">
                    Reducing <br />bottlenecks for big <br />change
                </div>
                <div class="bottom-text-paragraph fut-medium">
                    It is often very small bottlenecks holding back positive change, and
                    so small grants matter a lot. Grant making must be agile,
                    compassionate, and focused on problem solving in those ecological
                    spaces with the greatest ecological richness. Grants should not be
                    used to control communities and NGOs, and thus we believe in general
                    support. We build longterm, output-focused relationships with
                    partners, guiding them to find greater pools of support for their
                    authentic visions. We believe that storytelling support is just as
                    important as funds.
                    <br>
                    <br>
                    WE DO NOT HAVE CALLS FOR PROPOSALS BUT WELCOME LOCAL NGOS AND
                    COMMUNITIES THAT URGENTLY NEED SUPPORT IN PROTECTING LAND, WATERS OR
                    BIODIVERSITY TO GET IN TOUCH VIA THE CONTACT FORM OR BY EMAIL
                    (INFO@CLOUDFORESTFUND.ORG). WE TEND TO SUPPORT SMALLER SEED LEVEL
                    EFFORTS, WITH CAPACITY BUILDING, CO-VISIONING, FUNDING, AND
                    CONNECTIONS TO ALIGNED DONORS WHERE LARGER SUPPORT IS NEEDED. BUT WE
                    ALSO HELP MORE MATURE PROJECTS THAT NEED GUIDANCE ON FINDING FUNDS,
                    DRAFTING STRATEGIES AND STORYTELLING. WE DO EVERYTHING ONLY WITH THE
                    CONSENT OF PARTNERS.WE BELIEVE IN BUILDING LASTING FRIENDSHIPS AND
                    DEEP TIES WITH PARTNERS, AND ALSO IN ENJOYING THE JOURNEY.
                </div>
            </div>
        </div>
    </div>

