<script>
document.addEventListener("DOMContentLoaded", function () {
    const section = document.querySelector('.mountain-sect');
    const mountainBack = document.getElementById("mountainBack");
    const trigger = false;

  let previousScrollTop = window.pageYOffset || document.documentElement.scrollTop;

  // Function to handle scroll event
  function handleScroll(event) {
    const scrollTop = window.pageYOffset || document.documentElement.scrollTop;
    const scrollDirection = scrollTop > previousScrollTop ? 'down' : 'up';

    // Check if the section is intersecting with the viewport
    const sectionRect = section.getBoundingClientRect();
    const isIntersecting = sectionRect.top < window.innerHeight && sectionRect.bottom > 0;

    if (scrollDirection === 'up' && isIntersecting) {
        const sectionHeight = sectionRect.bottom - sectionRect.top;
        const scrollPosition = window.innerHeight - sectionRect.top;
        const scrollPercentage = (scrollPosition / sectionHeight) * 100;
        console.log(scrollPercentage);

        if (scrollPercentage > 70) {
            // Set a timeout to remove the classes after a certain delay
            setTimeout(function () {
                // Remove classes after the delay
                section.classList.remove('show');
            }, 1000); // Adjust the delay time as needed

            setTimeout(function () {
                // Remove classes after the delay
                mountainBack.classList.remove('slide-up');
            }, 1200); // Adjust the delay time as needed

            mtnActive = false;
            console.log(mtnActive);
            console.log('new code');
        }
    }

    if (scrollDirection === 'down' && isIntersecting) {
        section.classList.add("show");
        mountainBack.classList.add("slide-up");
    }




    previousScrollTop = scrollTop;
  }

  // Attach scroll event listener to the window
  window.addEventListener('scroll', handleScroll);
});
</script>



