<script>
    document.addEventListener("DOMContentLoaded", function () {

        const counterText1 = document.querySelector("#counter-text-1");
        const counterText2 = document.querySelector("#counter-text-2");
        const counterText3 = document.querySelector("#counter-text-3");
        const counterText4 = document.querySelector("#counter-text-4");
        const counterText5 = document.querySelector("#counter-text-5");
        // Function to handle intersection
        function handleIntersection(entries, observer) {
            entries.forEach((entry, index) => {
                if (entry.isIntersecting) {
                    // Play or reverse the animation based on scroll direction
                    playOrReverseAnimation(index, entry.boundingClientRect.y);
                    // Re-observe the target to continue watching for intersections
                    observer.observe(entry.target);
                }
            });
        }

        // Options for the Intersection Observer
        const options = {
            root: null,
            rootMargin: "0px",
            threshold: 0.9, // Trigger when 90% of the target is visible
        };

        // Create a new Intersection Observer
        const observer = new IntersectionObserver(handleIntersection, options);

        // Target elements
        const svgContainers = [
            document.getElementById("counter-img-1"),
            document.getElementById("counter-img-2"),
            document.getElementById("counter-img-3"),
            document.getElementById("counter-img-4"),
            document.getElementById("counter-img-5"),
        ];

        // Load animations for each target element
        const animations = svgContainers.map((svgContainer, index) => {
            if (svgContainer) { // Add this check
                const animItem = bodymovin.loadAnimation({
                    wrapper: svgContainer,
                    animType: "svg",
                    loop: false,
                    autoplay: false,
                    path: `https://lottie.host/45a33ab5-2a21-4ad4-89f7-3d7f10157461/w0mxsxxNj3.json`, // Adjust path accordingly
                });
                // Start observing each target element
                observer.observe(svgContainer);
                return animItem;
            } else {
                return null; // Return null if element is null
            }
        });

        // Function to play or reverse the animation for the given index
        function playOrReverseAnimation(index, scrollDirection) {
            const direction = scrollDirection > 0 ? 1 : -1; // 1 for scrolling down, -1 for scrolling up
            const animation = animations[index];
            // svgContainers[index].classList.remove("counter-hide");
            if (direction === 1) {
                console.log(direction);
                animation.setDirection(1);
                animation.goToAndPlay(0, true);
                counterText1.classList.add("show");
                counterText2.classList.add("show");
                counterText3.classList.add("show");
                counterText4.classList.add("show");
                counterText5.classList.add("show");
            } else {
                console.log(direction);
                animation.setDirection(-1);
                animation.goToAndPlay(animation.totalFrames, true);
                counterText1.classList.remove("show");
                counterText2.classList.remove("show");
                counterText3.classList.remove("show");
                counterText4.classList.remove("show");
                counterText5.classList.remove("show");
            }
            // Event listener for animation completion
            // animation.addEventListener("complete", () => {
            //     svgContainers[index].classList.add("counter-hide");
            // });
        }
    });
</script>




