<script>
    document.addEventListener("DOMContentLoaded", function () {
        const monkeySvg = document.getElementById("monkey-sect");
        const footer2 = document.querySelector("#footer2");
        const footer3 = document.querySelector("#footer3");
        const plant1 = document.querySelector(".left-plant-wrapper");
        const plant2 = document.querySelector(".right-plant-wrapper");
        const monkey = document.querySelector(".monkey-wrapper");
        const arch = document.querySelector(".monkey-arch-text");
        let drawingStarted = false;
        let lastScrollTop = 0;

        window.addEventListener('message', function(event) {
            if (event.data && event.data.type === 'splitterScrollPercentage') {
                const splitscrollpercent = event.data.value;
                if (!drawingStarted && splitscrollpercent > 0.15) {
                    console.log("splitter scroll percentage over 0.99, triggering action...");
                    drawingStarted = true;
                    animateDrawing();

                    // Attach scroll event listener
                    window.addEventListener("scroll", scrollHandler);
                }
            }
        });

        // Function to handle scroll events
        function scrollHandler() {
            // Check if the user is scrolling up or down
            const st = window.pageYOffset || document.documentElement.scrollTop;
            if (st > lastScrollTop) {
                // Scrolling down
                animateDrawing(true); // Pass 'true' to indicate scrolling down
            } else {
                // Scrolling up
                animateDrawing(false); // Pass 'false' to indicate scrolling up
            }
            lastScrollTop = st <= 0 ? 0 : st; // For Mobile or negative scrolling
        }

        // Function to check if an element is in the viewport
        function isInViewport(element) {
            const rect = element.getBoundingClientRect();
            return (
                rect.top >= 0 &&
                rect.left >= 0 &&
                rect.bottom <= (window.innerHeight || document.documentElement.clientHeight) &&
                rect.right <= (window.innerWidth || document.documentElement.clientWidth)
            );
        }

        function animateDrawing(scrollingDown) {
            // console.log('drawing monkey svg now');
            // Establish new scroll percentage based on scroll position within monkeysvg
            // Define the offset as a fraction of the container's height
            const offsetFraction = 0.61;

            // Calculate the offset based on the container's height
            const offset = monkeySvg.offsetHeight * offsetFraction;

            // Calculate the scroll percentage with the offset
            let monkeyScrollpercent =
                Math.min(Math.max((window.scrollY - monkeySvg.offsetTop + offset) / (monkeySvg.offsetHeight - offset), 0), 1);


            let drawLength = 700 * monkeyScrollpercent * 2 ; // Total length of the path
            footer2.style.strokeDasharray = `${drawLength}, 700`;
            footer3.style.strokeDasharray = `${drawLength}, 700`;

            // footer2.style.strokeDashoffset = drawLength;
            // footer3.style.strokeDashoffset = drawLength;

            // Add classes based on current scroll position and scrolling direction
            if (scrollingDown) {
                if (monkeyScrollpercent >= 0.05) {
                    plant1.classList.add("show");
                    plant2.classList.add("show");
                }
                if (monkeyScrollpercent >= 0.05) {
                    monkey.classList.add("show");
                    arch.classList.add("show");
                }
            } 
            if(monkeyScrollpercent < 0.20){
                // Remove classes when scrolling up
                plant1.classList.remove("show");
                plant2.classList.remove("show");
                monkey.classList.remove("show");
                arch.classList.remove("show");
            }
            if (monkeyScrollpercent >= 0.54) {
                window.postMessage({ type: 'monkeyScroll', value: monkeyScrollpercent }, '*');
            }
        }
    });
</script>

