<!-- TOPSVG -->
<script>
    document.addEventListener("DOMContentLoaded", function () {

        // Debounce function with a shorter delay
        function debounce(func, wait) {
            let timeout;
            return function () {
                const context = this,
                    args = arguments;
                const later = function () {
                    timeout = null;
                    func.apply(context, args);
                };
                clearTimeout(timeout);
                timeout = setTimeout(later, wait);
            };
        }

        var pathLeft = document.querySelector('#svgPathLeft');
        var pathRight = document.querySelector('#svgPathRight');

        var pathLengthLeft = pathLeft.getTotalLength();
        var pathLengthRight = pathRight.getTotalLength();

        pathLeft.style.strokeDasharray = pathLengthLeft;
        pathRight.style.strokeDasharray = pathLengthRight;

        pathLeft.style.strokeDashoffset = pathLengthLeft;
        pathRight.style.strokeDashoffset = pathLengthRight;

        var impactFade = document.querySelector('.impact-fade-in-div');
        var impactninety1 = document.querySelector('.ninety-left');
        var impactninety2 = document.querySelector('.ninety-right');
        var blurbFade1 = document.querySelector('.topSvgBlurbLeft');
        var blurbFade2 = document.querySelector('.topSvgBlurbRight');
        var counters = document.querySelector('.counter-container');
        var fadeInStarted = false;

        window.addEventListener(
            "scroll",
            debounce(function () {
                var scrollPercentage = 10 * ((Math.max(0, window.scrollY - 7 * parseFloat(getComputedStyle(document.documentElement).fontSize))) / (document.documentElement.scrollHeight - window.innerHeight));

                // Length to offset the dashes
                var drawLeft = pathLengthLeft * scrollPercentage;
                var drawRight = pathLengthRight * scrollPercentage;

                // Draw in reverse
                pathLeft.style.strokeDashoffset = Math.max(0, pathLengthLeft - drawLeft);
                pathRight.style.strokeDashoffset = Math.max(0, pathLengthRight - drawRight);

                // Fade in div smoothly when the line is about 15% drawn
                if (scrollPercentage >= 0.29 && !fadeInStarted) {
                    fadeInStarted = true;

                    impactFade.classList.add('show');
                    impactninety1.classList.add('show');
                    impactninety2.classList.add('show');
                }else if(scrollPercentage < 0.29){
                    fadeInStarted = false;

                    impactFade.classList.remove('show');
                    impactninety1.classList.remove('show');
                    impactninety2.classList.remove('show');
                }

                if (scrollPercentage >= 0.57) {
                    blurbFade1.classList.add('show');
                    blurbFade2.classList.add('show');
                }else if (scrollPercentage < 0.57) {
                    blurbFade1.classList.remove('show');
                    blurbFade2.classList.remove('show');
                }

                if (scrollPercentage >= 0.75) {
                    counters.classList.add('show');
                } else if (scrollPercentage < 0.75) {
                    counters.classList.remove('show');
                }

                // Post scrollPercentage to other script if it's over 0.99
                if (scrollPercentage > 0.99) {
                    window.postMessage({ type: 'scrollPercentage', value: scrollPercentage }, '*');
                }

            }, 5) // Decreased debounce delay to 5ms
        );

        // function fadeInDivSmoothly(element) {
        //     var opacity = 0;
        //     var interval = setInterval(function () {
        //         opacity += 0.05; // Adjust the increment value as needed for the desired speed
        //         element.style.opacity = opacity;
        //         if (opacity >= 1) {
        //             clearInterval(interval);
        //         }
        //     }, 40); // Decreased interval duration for smoother animation
        // }
        
    });


</script>

<!-- WAVYTEXT -->
<script>
    document.addEventListener("DOMContentLoaded", function () {

        const topLottiePlayer = document.getElementById("top-wavy").querySelector("dotlottie-player");
        const bottomLottiePlayer = document.getElementById("bottom-wavy").querySelector("dotlottie-player");
        let animationPlayed = false;

        topLottiePlayer.stop();
        bottomLottiePlayer.stop();

        $(window).scroll(function () {
            const bottomTextPlayer = $('.bottom-text-player');
            const bottomTextOffset = bottomTextPlayer.offset().top;
            const bottomTextHeight = bottomTextPlayer.outerHeight();
            const windowHeight = window.innerHeight;

            if ($(window).scrollTop() >= bottomTextOffset + bottomTextHeight - windowHeight) {
                if (!animationPlayed) {
                    topLottiePlayer.play();
                    bottomLottiePlayer.play();
                    animationPlayed = true;
                }
            } else {
                // Reset animation when scrolling back
                animationPlayed = false;
                topLottiePlayer.stop();
                bottomLottiePlayer.stop();
            }
        });
    });

</script>